import BaseLayout from '../components/BaseLayout'
import Link from 'next/link';

const PostLink = (props) => (
    <Link href={`single?title=${props.title}`}>
        <a> {props.title} </a>
    </Link>
);

const Blog = () => (
    <BaseLayout>
        <h1>Welcome to Blog.js</h1>
        <ul>
            <PostLink title="Artikel Pertama"/>
            <PostLink title="Artikel Kedua"/>
            <PostLink title="Artikel Terakhir"/>
        </ul>
    </BaseLayout>
)

export default Blog;
